import React, { Component } from "react";

class patient extends Component {

  constructor(props) {
    super(props);     //inherit from React.Component

  }

  render() {
    console.log(this.state);
    return( 
      <div>
        <h1>Patient Data</h1>
        <ul>
          <li>Patient Name</li>
          <li>Age</li>
          <li>Height</li>
          <li>Weight</li>
        </ul>
      </div>

    );
  }
}

export default patient;
